import React, { useState, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { FaFacebook, FaInstagram, FaLinkedin } from 'react-icons/fa';
import MyImage from './image/logo1.png';
import './navbar.css';

const NavBarHarsh = () => {
  const [menuOpen, setMenuOpen] = useState(false);
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const navigate = useNavigate();

  // Check login status on component mount
  useEffect(() => {
    const token = localStorage.getItem('token');
    setIsLoggedIn(!!token);
  }, []);

  const handleLogout = () => {
    localStorage.removeItem('token');
    setIsLoggedIn(false);
    navigate('/'); // Redirect to home or login page if you prefer
  };

  return (
    <div>
      <div className="hero-section">
        <header className="header">
          <div className="top-bar">
            <div className="social-icons">
              <div className="social-media-icons">
                <a href="https://www.facebook.com" target="_blank" rel="noopener noreferrer">
                  <FaFacebook size={30} />
                </a>
                &nbsp;&nbsp;&nbsp;
                <a href="https://www.instagram.com" target="_blank" rel="noopener noreferrer">
                  <FaInstagram size={30} />
                </a>
                &nbsp;&nbsp;&nbsp;
                <a href="https://www.linkedin.com" target="_blank" rel="noopener noreferrer">
                  <FaLinkedin size={30} />
                </a>
              </div>
            </div>
            <div className="contact">
              <span>&nbsp;&nbsp;&nbsp;&nbsp;9752881492</span>
              <span>&nbsp;&nbsp;infozaeeshcorporation@gmail.com</span>
            </div>

            <div className="contact-1">
              {/* Show Login|Sign-Up if not logged in */}
              {!isLoggedIn ? (
                <div>&nbsp;&nbsp;<Link to="/form/signup">Login|Sign-Up</Link></div>
              ) : (
                <div>
                  &nbsp;&nbsp;<button onClick={handleLogout} className="logout-button">Logout</button>
                </div>
              )}
            </div>
          </div>

          {/* Navbar */}
          <nav className="navbar">
            <div className="logo">
              <img className="logo-img" src={MyImage} alt="Logo" />
            </div>
            <div className="menu-icon" onClick={() => setMenuOpen(!menuOpen)}>
              â˜°
            </div>
            <div className="navmain">
              <ul className={`nav-links ${menuOpen ? 'show' : ''}`}>
                <li><Link to="/">HOME</Link></li>
                <li><Link to="/src/Pages/ServicePage.js">SERVICES</Link></li>
                <li><Link to="/src/Pages/AboutPage.js">ABOUT US</Link></li>
                <li><Link to="/src/Pages/ProductPage.js">PRODUCT</Link></li>
                <li><Link to="/src/Pages/PrivacyPolicy.jsx">PRIVACY & POLICY</Link></li>
                <li><Link to="/src/Pages/ContactPage.js">CONTACT US</Link></li>
              </ul>
            </div>
          </nav>
        </header>
      </div>
    </div>
  );
};

export default NavBarHarsh;
